  \"2015-12-20T18:32:53.095095\",\n\t\"name\": \"west-coast-fishing-closures-2015\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data delineate state and federally
  managed ocean areas off the West Coast of the United States that are closed to or
  have restrictions on commercial or recreational fishing for fish and invertebrates
  as of June 2015. These areas include marine protected areas, marine reserves, essential
  fish habitat conservation areas, and other types of conservation areas. Closures
  and restrictions may be year-round or seasonal. The data do not include all spatially
  explicit fishing regulations. The focus of these data is on fishing closures and
  restrictions that generally persist through time, and do not include many fishing
  management measures that are used to open and close areas dynamically to manage
  species, harvests, and seasons. Some areas where access is prohibited or restricted
  are included because these act as \"de-facto\" closures or restrictions to fishing.\",\n\t\"license_title\":
